import React from 'react';
import Video from './Video';

function VideoList({ videos, onToggleWatched, onDelete }) {
  return (
    <div>
      {videos.map((video) => (
        <Video
          key={video.id}
          video={video}
          onToggleWatched={onToggleWatched}
          onDelete={onDelete}
        />
      ))}
    </div>
  );
}

export default VideoList;
